        jokeService.findJokeById(this.props.resultId)
    }

    render() {
        return (
            <div className={"container-fluid"}>
                <h1>{this.props.criteria}: {jokeService.findJokeById(this.props.resultId)}</h1>
                <img src={`https://icanhazdadjoke.com/j/${this.props.resultId}.png`} />
